import React, { useState } from "react";
import axios from "axios";
import "./App.css";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [encryptionMethod, setEncryptionMethod] = useState("AES");
  const [encryptionKey, setEncryptionKey] = useState("");
  const [manualKey, setManualKey] = useState("");
  const [loading, setLoading] = useState(false);

  const handleFileChange = (e) => setSelectedFile(e.target.files[0]);

  const handleEncrypt = async () => {
    if (!selectedFile) return toast.error("Please select a file!");
    setLoading(true);

    const formData = new FormData();
    formData.append("file", selectedFile);
    formData.append("method", encryptionMethod);

    try {
      const response = await axios.post("http://127.0.0.1:5000/encrypt", formData, {
        responseType: "blob",
      });

      const key = response.headers["x-encryption-key"];
      if (!key) {
        toast.error("No encryption key received!");
        return;
      }

      setEncryptionKey(key);
      toast.success("File encrypted successfully!");

      // download the encrypted file
      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", `${selectedFile.name}.encrypted`);
      document.body.appendChild(link);
      link.click();
    } catch (error) {
      console.error("Encryption failed:", error);
      toast.error("Encryption failed ‚Äî check backend logs.");
    } finally {
      setLoading(false);
    }
  };

  const handleDecrypt = async () => {
    if (!selectedFile || !manualKey)
      return toast.error("Select a file and enter a decryption key!");
    setLoading(true);

    const formData = new FormData();
    formData.append("file", selectedFile);
    formData.append("key", manualKey);
    formData.append("method", encryptionMethod);

    try {
      const response = await axios.post("http://127.0.0.1:5000/decrypt", formData, {
        responseType: "blob",
      });

      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", `decrypted_${selectedFile.name}`);
      document.body.appendChild(link);
      link.click();
      toast.success("File decrypted successfully!");
    } catch (error) {
      console.error("Decryption failed:", error);
      toast.error("Decryption failed ‚Äî check your key or backend logs.");
    } finally {
      setLoading(false);
    }
  };

  const handleCopyKey = () => {
    if (navigator.clipboard && encryptionKey) {
      navigator.clipboard.writeText(encryptionKey);
      toast.info("Key copied to clipboard!");
    } else {
      toast.error("Clipboard not available or no key found!");
    }
  };

  return (
    <div className="app-container">
      <h1>üîê SecureScan Encryption Suite</h1>
      <p>Encrypt & decrypt your sensitive files with multiple algorithms.</p>

      <label>Select Encryption Method:</label>
      <select
        value={encryptionMethod}
        onChange={(e) => setEncryptionMethod(e.target.value)}
      >
        <option value="AES">AES (Symmetric)</option>
        <option value="RSA">RSA (Asymmetric)</option>
        <option value="Fernet">Fernet (Token-based)</option>
      </select>

      <label>Choose File:</label>
      <input type="file" onChange={handleFileChange} />

      <div className="button-group">
        <button onClick={handleEncrypt} disabled={loading}>
          {loading ? "Encrypting..." : "Encrypt File"}
        </button>
        <button onClick={handleDecrypt} disabled={loading}>
          {loading ? "Decrypting..." : "Decrypt File"}
        </button>
      </div>

      {/* === Show generated key after encryption === */}
      {encryptionKey && (
        <div className="key-box">
          <p>Generated Encryption Key:</p>
          <textarea value={encryptionKey} readOnly />
          <button className="copy-btn" onClick={handleCopyKey}>
            Copy Key
          </button>
        </div>
      )}

      {/* === Manual key input for decryption === */}
      <div className="key-box">
        <p>Enter Decryption Key:</p>
        <textarea
          value={manualKey}
          onChange={(e) => setManualKey(e.target.value)}
          placeholder="Paste your encryption key here..."
        />
      </div>

      <ToastContainer position="bottom-right" theme="dark" />
    </div>
  );
}

export default App;
